import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import web from "../src/Images/pic2.jpg";
import Common from "./Common";


const About = () => {


    return (
        <>

            <Common
                name='Welcome to About Page'
                imgsrc={web}
                visit="/contact"
                btnname="Contact Now"
            />


        </>
    );
};
export default About;
